const docs = {
    getAllDocs: async function getAllDocs() {
        let a = `${URL}/docs`;
        console.log("helo world");
        console.log("url is "+ a);
        //const response = await fetch(`${URL}/docs`); // Hämtar allt som ligger bakom url/docs
        const response = await fetch("http://localhost:1337/docs");

        const result = await response.json(); // Gör om det till json?'


        console.log(result);
        return result.data;
    },
};

export default docs;
